import React from "react";

const SKILLS = [
  { id: "css", name: "CSS3", url: "https://developer.mozilla.org/en-US/docs/Web/CSS", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/css3/css3-original.svg" },
  { id: "flutter", name: "Flutter", url: "https://flutter.dev/", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/flutter/flutter-original.svg" },
  { id: "spring", name: "Spring Boot", url: "https://spring.io/projects/spring-boot", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/spring/spring-original.svg" },
  { id: "sql", name: "SQL", url: "https://www.mysql.com/", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mysql/mysql-original.svg" },
  { id: "mongodb", name: "MongoDB", url: "https://www.mongodb.com/", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mongodb/mongodb-original.svg" },
  { id: "react", name: "React.JS", url: "https://reactjs.org/", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/react/react-original.svg" },
  { id: "html", name: "HTML", url: "https://developer.mozilla.org/en-US/docs/Web/HTML", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/html5/html5-original.svg" },
  { id: "java", name: "Java", url: "https://www.oracle.com/java/", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/java/java-original.svg" },
  { id: "js", name: "Javascript", url: "https://developer.mozilla.org/en-US/docs/Web/JavaScript", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/javascript/javascript-original.svg" },
  { id: "node", name: "Node.JS", url: "https://nodejs.org/", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/nodejs/nodejs-original.svg" },
  { id: "python", name: "Python", url: "https://www.python.org/", logo: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original.svg" },
];

export default function SkillsSection() {
  return (
    <section id="skills" className="py-20 bg-[#030417] text-white">
      <div className="max-w-6xl mx-auto px-6 text-center">
        <p className="text-sm uppercase tracking-widest text-[var(--accent)]">Experience</p>
        <h3 className="mt-3 mb-10 text-3xl sm:text-4xl font-display font-bold">Skills</h3>

        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-4 gap-12 md:gap-16 justify-items-center">
          {SKILLS.map((s) => (
            <div key={s.id} className="flex flex-col items-center gap-4">
              <a
                href={s.url}
                target="_blank"
                rel="noopener noreferrer"
                title={s.name}
                className="w-24 h-24 rounded-full flex items-center justify-center bg-[#0e1624] border border-white/6 transition transform hover:-translate-y-1 hover:shadow-glow"
                aria-label={s.name}
              >
                <img src={s.logo} alt={s.name} className="w-12 h-12 object-contain" />
              </a>
              <div className="text-sm text-gray-300">{s.name}</div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
}
